Text:
@yunamusic There’s a reason ramai golongan professional menasihatkan untuk elak baca news (newspaper &amp; TV News).

Penulis berita sudah terlampau toxic dengan headline yang ‘menarik’ minat pembaca. And here we are M’sian memang suka berita sensasi dan negatif.

Hence the choice of words.

translated:
@yunamusic There's a reason many professional groups advise avoiding reading news (newspaper & TV News).

News writers are too toxic with headlines that 'attract' readers' interest. And here we are M'sian really likes sensational and negative news.

Hence the choice of words.

